        image: p5_img,
        new_price: 60.00,
        old_price: 100.50,
    },
    {
        id: 4,
        name: "เสื้อนักศึกษาหญิงถูกระเบียบ ทรงเข้ารูป สีขาวนวล|ขาวสว่าง|ขาวโอโม่ [S M L XL XXL]",
